import { Button, Cascader, Form, Input, Select, TreeSelect } from "antd";

const TaskForm = () => {
  const PriorityOptions = [{ value: "One" }, { value: "Two" }, { value: "Three" }];

  return (
    <>
      <h1>TODO - APP</h1>
      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        style={{
          maxWidth: 600,
        }}
      >
        <Form.Item label="Task">
          <Input />
        </Form.Item>
        <Form.Item label="Priority">
          <Select>
            <Select.Option value="demo">Demo</Select.Option>
          </Select>
        </Form.Item>
        <Form.Item label="Status">
          <Select></Select>
        </Form.Item>
        <Form.Item label="Cascader">
          <Cascader
            options={[
              {
                value: "zhejiang",
                label: "Zhejiang",
                children: [
                  {
                    value: "hangzhou",
                    label: "Hangzhou",
                  },
                ],
              },
            ]}
          />
        </Form.Item>
      </Form>
    </>
  );
};
export default TaskForm;
